import React from "react";
import classes from "./ContractIDForm.module.css"
import { History } from "history";

export const ContractIDForm = ({setHeaderName, history }: {setHeaderName?: (val:string)=>void, history?: History }) => {
      const [contractID] = React.useState("dc89ff49-8449-11e7-ac1d-3c52820efd20");

      React.useEffect(()=> {
        if(!setHeaderName)
         return;
        setHeaderName("Case Finder");
    },[setHeaderName])




      const onSubmit = (e:any) => {
        e.preventDefault();
        if(history) {
          const appendPath = history.location.pathname.endsWith("/")?`contracts/${contractID}`:`/${contractID}`;
          history.push(`${history.location.pathname}${appendPath}`)  
        }
      }


        return (
          <div className={classes.fullscreenDiv} >
          <form onSubmit={onSubmit}>
            <div className={classes.center}>
              <label className={classes.padding} >
                <input type="text" className={classes.textbox} value={contractID} disabled={true}/>
              </label>
              <input type="submit" className={classes.button} value="Submit"  />
           </div>
          </form>

          </div>
        );

}
